var top = document.getElementById('overlaytop');
var bottom = document.getElementById('overlaybottom');

class cssFunctions{
    constructor(){
        this.top = document.getElementById('overlaytop');
    }

    removeverlay() {
        top.style.display = 'none';
        bottom.style.display = 'none';
    }

}
